import { BrowserRouter, Routes, Route } from "react-router-dom";
//import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import EmployeeList from "./components/EmployeesList";
//import NotFound from './components/NotFound';
import "bootstrap/dist/css/bootstrap.min.css";
//import AddEmployee from './components/AddEmployee';
import StudentSignin from "./components/studentlogin";
import ViewResult from "./components/StudentResult";
import ViewAttendance from "./components/StudentAttendance";
import StudentSignup from "./components/EnrollStudent";
import ParentDataDisplay from "./components/ViewParentDetails";
import ParentUpdate from "./components/ParentUpdate";
import StudentDataDisplay from "./components/ViewStudentData";
import TeacherDataDisplay from "./components/ViewTeacherData";
import StudentUpdate from "./components/StudentUdpate";
import TeacherUpdate from "./components/TeacherUpdate";
import AddResult from "./components/AddResult";
import AddAttendance from "./components/AddAttendance";
import AddTimeTable from "./components/AddTimeTable";
import ViewIssue from "./components/ViewIssue";
import TeacherSignin from "./components/TeacherLogin";
import ViewTimeTable from "./components/ViewTimeTable";

function App() {
  return (
    <BrowserRouter>
      <div>
        <div>
          <Routes>
            <Route exact path="/ViewResult/:id" element={<ViewResult />} />
            <Route
              exact
              path="/ViewAttendance/:id"
              element={<ViewAttendance />}
            />
            <Route exact path="/" element={<StudentSignin />} />
            <Route exact path="/Signup" element={<StudentSignup />} />
            <Route exact path="/Parent" element={<ParentDataDisplay />} />
            <Route exact path="/ParentUpdate" element={<ParentUpdate />} />
            <Route exact path="/Student" element={<StudentDataDisplay />} />
            <Route exact path="/StudentUpdate" element={<StudentUpdate />} />
            <Route exact path="/Teacher" element={<TeacherDataDisplay />} />
            <Route exact path="/TeacherUpdate" element={<TeacherUpdate />} />
            <Route path='/Result' element={<AddResultt />} />
            <Route path='/Attendance' element={<AddAttendance />} />
            <Route path='/Timetable' element={<AddTimeTable />} />
            <Route path='/ViewIssue' element={<ViewIssue />} />
            <Route exact path='/TeacherSignin' element={< TeacherSignin/>} />
            <Route exact path='/ViewTimeTable' element={< ViewTimeTable/>} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
